import React from "react";

class ListItem extends React.Component {
  constructor() {
    super();
    this.state = {
      task: this.props.item.task,
      complete: this.props.item.complete
    };
  }

  render() {
    return (
      <div>
        <p>{this.state.task}</p>
      </div>
    );
  }
}

export default ListItem;
